import React from 'react';
import { AppBar, Toolbar, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <AppBar 
      position="static" 
      color="transparent" 
      elevation={0}
      sx={{
        borderBottom: '1px solid #e0e0e0',
        marginBottom: 2
      }}
    >
      <Toolbar>
        <Link to="/">
          <img 
            src="/images/LogoGani.jpeg" 
            alt="Gani Import" 
            style={{ 
              height: '60px',
              marginRight: '20px',
              objectFit: 'contain'
            }}
          />
        </Link>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
